import React from "react";
import Col from "react-bootstrap/Col";
// ES6 function syntax

const Useroutput = (props) => {
  return (
    <Col md={6}>
      <div className="cards">
        <h1>Hey There!</h1>
        <p>{props.paragraph}</p>
      </div>
    </Col>
  );
};

export default Useroutput;
